import React from "react";
import styled from "styled-components";
const locationArr = [
  "서울",
  "경기",
  "강원",
  "전남",
  "경북",
  "경남",
  "광주",
  "부산",
  "울산",
  "충북",
  "충남",
  "전북",
  "인천",
  "대전",
  "세종",
  "대구",
];
const Wrapper = styled.div``;
function LocationSelect() {
  return (
    <Wrapper>
      {locationArr.map((item, idx) => {
        return (
          <div key={idx}>
            <button></button>
            <span>{item}</span>
          </div>
        );
      })}
    </Wrapper>
  );
}

export default LocationSelect;
